import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { ListeUserComponent } from './components/liste-user/liste-user.component';
import { UserManagementRoutingModule } from './user-management-routing.module';


import { MatTableModule} from '@angular/material/table';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule} from '@angular/material/input';
import { MatIconModule} from '@angular/material/icon';
import { MatButtonModule} from '@angular/material/button';
import { MatMenuModule } from '@angular/material/menu';
import { DialogAddUserComponent } from './components/dialog-add-user/dialog-add-user.component';
import { DialogEditUserComponent } from './components/dialog-edit-user/dialog-edit-user.component';
import { MatPaginatorModule } from '@angular/material/paginator';
import { MatDialogModule} from '@angular/material/dialog';
import { DialogViewUserComponent } from './components/dialog-view-user/dialog-view-user.component';
import { MatRadioModule} from '@angular/material/radio';
import { MatCheckboxModule} from '@angular/material/checkbox';
import { ViewUserComponent } from './components/view-user/view-user.component';
import { MatTooltipModule} from '@angular/material/tooltip';
import { MatCardModule } from '@angular/material/card';
import { ReactiveFormsModule } from '@angular/forms';
import { AngularSplitModule } from 'angular-split';

import { TableModule } from 'primeng/table';
import { ButtonModule } from 'primeng/button';
import { DispensaireComponent } from './components/dispensaire/dispensaire.component';


import { FormsModule } from '@angular/forms';
import { MatSelectModule } from '@angular/material/select';

import { CardModule } from 'primeng/card';

@NgModule({
  declarations: [
    ListeUserComponent,
    DialogAddUserComponent,
    DialogEditUserComponent,
    DialogViewUserComponent,
    ViewUserComponent,
    DispensaireComponent,
  ],
  imports: [
    CommonModule,
    UserManagementRoutingModule,
    FormsModule,
    MatSelectModule,
    CardModule,
    MatTableModule,
    MatFormFieldModule,
    MatInputModule,
    MatIconModule,
    MatButtonModule,
    MatMenuModule,
    MatPaginatorModule,
    MatDialogModule,
    MatRadioModule,
    MatCheckboxModule,
    MatTooltipModule,
    MatCardModule,
    ReactiveFormsModule,
    AngularSplitModule ,

    TableModule,
    ButtonModule



  ]
})
export class UserManagementModule { }
